    false,nt"url": null,nt"notes": "This is an overview for the proposed fire
    effect research project for Fort Niobrara and Valentine National Wildlife Refuges,
    focusing on the Nebraska Sandhills ecosystem. The proposal is for a panel of experts
    to meet and discuss fire effects, review scientific literature on fire effects in
    the Sandhills and develop a research project that could be conducted as a graduate
    student project or contracted.  This plan is intended to utilize adaptive management,
    and fire effects research in the area may assist the Refuge alter its management
    techniques to meet its objectives better.",nt"license_title": "License Not
